import React from "react";
import { useNavigate } from 'react-router-dom';
import "./CommunityPage.css";

const CommunityPage = () => {
    const myCommunities = ["Drake", "Ado", "Limit"];
    const recommendedCommunities = ["Hip-Hop Heads", "Classical Masters", "EDM Nation"];

    const navigate = useNavigate();

    const handleBackButton = () => {
        console.log("Go back clicked");
        navigate("/settings");
    };

    return (
        <div className="community-page">
            <button className="back-button" onClick={handleBackButton}>Go Back</button>
            <h1>Community Page</h1>

            {/* Search Bar */}
            <div className="search-container">
                <input type="text" placeholder="Search for communities..." />
            </div>

            {/* My Communities */}
            <h2>My Communities</h2>
            <div className="scrollable-list">
                {myCommunities.map((item, index) => (
                    <div className="community-item" key={index}>
                        <div className="community-image"></div>
                        <span>{item}</span>
                    </div>
                ))}
            </div>

            {/* Recommended Communities */}
            <h2>Recommended Communities</h2>
            <div className="scrollable-list">
                {recommendedCommunities.map((item, index) => (
                    <div className="community-item" key={index}>
                        <div className="community-image"></div>
                        <span>{item}</span>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default CommunityPage;
